import React from 'react';
import Navigation from './Navigation';

const Layout = ({children})=>{
    return(
        <>
            <Navigation />
            <div>
                {children}
            </div>

            <style jsx>{`
                div{
                    background: #2F3540;

                }
            
        `}</style>
        </>
    )
}
export default Layout;
